function PopupWithForm(props){
    return(
        <div className="popup" id ={`popup${props.name}`}>
        <form className="form " id ={`form${props.name}`} method="post" noValidate>
          <h2 className="form__title">{props.title}</h2>
          {props.firstIn}
          <span className="form__input-error form__name-error"></span>
          {props.secondIn}
          <span className="form__input-error form__about-error"></span>
          <button type="submit" className="form__save-button" id="saveProfile" disabled>{props.button}</button>
        </form>
        <button type="button" className="popup__close-button "></button>
      </div>
    )
}

export default PopupWithForm
